isplayModeBar":true,"modeBarButtons":[["toImage","resetScale2d"]],"showAxisDragHandles":true,"toImageButtonOptions":{"width":730,"height":650},"scrollZoom":false},"layout":{"xaxis":{"type":"linear","title":"t-SNE1","showline":false,"zeroline":true,"fixedrange":false},"yaxis":{"type":"linear","title":"t-SNE2","showline":false,"zeroline":true,"fixedrange":false},"margin":{"t":30},"hovermode":"closest","title":"t-SNE Projection of Cells by Clustering","hover_mode":"closest","font":{"family":"DIN Next LT Pro"}}},"plot_help":{"data":[["",["(left) Shown here are the total UMI counts for each cell-barcode. Cells with greater UMI counts likely have higher RNA content than cells with fewer UMI counts. The axes correspond to the 2-dimensional embedding produced by the t-SNE algorithm. In this space, pairs of cells that are close to each other have more similar gene expression profiles than cells that are distant from each other. The display is limited to a random subset of cells.","(right) These are the assignments of each cell-barcode to clusters by an automated clustering algorithm. The clustering groups together cells that have similar expression profiles. The axes correspond to the 2-dimensional embedding produced by the t-SNE algorithm. In this space, pairs of cells that are close to each other have more similar gene expression profiles than cells that are distant from each other. The display is limited to a random subset of cells. Please use Loupe Browser to view the entire dataset."]]],"title":"t-SNE Projection"},"table_help":{"helpText":"The differential expression analysis seeks to find, for each cluster, features that are more highly expressed in that cluster relative to the rest of the sample. Here a differential expression test was performed between each cluster and the rest of the sample for each feature. The Log2 fold-change (L2FC) is an estimate of the log2 ratio of expression in a cluster to that in all other cells. A value of 1.0 indicates 2-fold greater expr
